import React, { useEffect, useState } from 'react'
import { localhost } from '../../config/config';
import './style.css'

const Home = () => {
    const [Products, setProducts] = useState([])

    useEffect(() => {
        getAllProducts();
    }, [])

    const getAllProducts = async () => {
        let res = await fetch(`${localhost}/products`)
        res = await res.json()
        setProducts(res)
    }

