        <div className=''>
            <h1>All Products</h1>
            <ul className='items'>
                <li>name</li>
                <li>price</li>
                <li>category</li>
                <li>company</li>
            </ul>

            {
                Products.map((item, index) => (
                    <ul key={index} className='items'>
                        <li>{item.name}</li>
                        <li>{item.price}</li>
                        <li>{item.category}</li>
                        <li>{item.company}</li>
                    </ul>
                ))
            }
        </div>
    )
}

export default Home
